import React from "react";

function About() {
  return (
    <div className="about-section" style="background-color:#202A44">
      <h1 className="about-header">About Us</h1>
      <p className="about-content">
        Terrazas de Guacuco, is a huge premier residential complex in Venezuela.
        It has 367 residential units classified as Studios, Town Houses, and
        cabins. It has two swimming pools, several gardens, tennis courts and
        several walking trials. There are several managers at the complex,
        manager garden manager, pool manager, building manager. There is a high
        security at the complex that works 24 hrs. a day. Complex has about 200
        watchmen. Complex has owners, short term rentals and long term rentals
        and visitors. Anyone coming to the complex has to register his/her
        visit. Registration includes drivers, plate car, drivers license and DL
        for each person in the car. Even if you get in walking, you have to
        register. Visitors need to register and are given driving instructions
        to guide them
      </p>
    </div>
  );
}


export default About;
